import bgImage from "assets/images/bg-sign-in.jpeg";
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";
import { Form, FormGroup, FormControl, Button } from 'react-bootstrap';
function Reservation(){
    return(<><div>
        <Form>
          <FormGroup>
            <FormControl type="text" placeholder="Votre nom" />
          </FormGroup>
          <FormGroup>
            <FormControl type="date" placeholder="Date d'arrivée" />
          </FormGroup>
          <FormGroup>
            <FormControl type="date" placeholder="Date de départ" />
          </FormGroup>
          <FormGroup>
            <FormControl type="number" placeholder="Adultes" />
          </FormGroup>
          <FormGroup>
            <FormControl type="number" placeholder="Enfants" />
          </FormGroup>
          <Button type="submit">Vérifier la disponibilité</Button>
        </Form>
      </div>
            </>);
}
